import { combineReducers } from "redux";
import FaqReducer from "./FaqReducer";
import MenuReducer from "./MenuReducer";
import CurrentFaq from "./CurrentFaq";

export default combineReducers({
    faq : FaqReducer,
    currentFaq : CurrentFaq,
    menu : MenuReducer
});
